export const getMainCategoryLabel = (mainCategory?: string | null): string => {
  if (!mainCategory) return "";
  return MAIN_CATEGORY_LABELS[mainCategory] || mainCategory;
};

export const getTopmenuFromMainCategory = (mainCategory?: string | null): string => {
  if (!mainCategory) return "";
  return MAIN_CATEGORY_TO_TOPMENU[mainCategory] || "";
};

export const getMainCategoryFromTopmenu = (topmenu?: string | null): string => {
  if (!topmenu) return "";
  return TOPMENU_TO_MAIN_CATEGORY[topmenu] || "";
};

const getBrandModelMapByTopmenu = (topmenu?: string | null): Record<string, string[]> => {
  if (!topmenu) return {};
  return BRAND_MODELS_BY_TOPMENU[topmenu] || {};
};

export const getBrandOptionsByTopmenu = (topmenu?: string | null): string[] => {
  const map = getBrandModelMapByTopmenu(topmenu);
  return Object.keys(map);
};

export const getModelOptionsByTopmenu = (topmenu?: string | null, brand?: string | null): string[] => {
  const map = getBrandModelMapByTopmenu(topmenu);
  if (!brand) return [];
  return map[brand] || [];
};

export const getBrandOptionsByMainCategory = (mainCategory?: string | null): string[] => {
  const topmenu = getTopmenuFromMainCategory(mainCategory);
  return getBrandOptionsByTopmenu(topmenu);
};

export const getModelOptionsByMainCategory = (mainCategory?: string | null, brand?: string | null): string[] => {
  const topmenu = getTopmenuFromMainCategory(mainCategory);
  return getModelOptionsByTopmenu(topmenu, brand);
};

export const getPartCategories = (topmenu?: string | null): string[] => {
  if (!topmenu) return [];
  const map = PART_OPTIONS_BY_TOPMENU[topmenu] || {};
  return Object.keys(map);
};

export const getPartElements = (topmenu?: string | null, partCategory?: string | null): string[] => {
  if (!topmenu || !partCategory) return [];
  const map = PART_OPTIONS_BY_TOPMENU[topmenu] || {};
  return map[partCategory] || [];
};

export const getAccessoryCategories = (topmenu?: string | null): string[] => {
  if (!topmenu) return [];
  return ACCESSORY_CATEGORIES_BY_TOPMENU[topmenu] || [];
};

export const getWheelOfferTypeOptions = (topmenu?: string | null): SelectOption[] => {
  if (!topmenu) return [];
  return WHEEL_OFFER_OPTIONS_BY_TOPMENU[topmenu] || [];
};

export const getWheelPcdOptions = (bolts?: string | null): string[] => {
  if (!bolts) return [];
  return WHEEL_PCD_OPTIONS_BY_BOLTS[bolts] || [];
};

export const getCriteriaMainCategoryCode = (criteria: Record<string, unknown> | null | undefined): string => {
  if (!criteria || typeof criteria !== "object") return "";
  const raw = criteria.mainCategory ?? criteria.main_category ?? criteria.pubtype ?? "";
  return typeof raw === "string" ? raw : String(raw || "");
};

export const getCriteriaMainCategoryLabel = (criteria: Record<string, unknown> | null | undefined): string => {
  const code = getCriteriaMainCategoryCode(criteria);
  return getMainCategoryLabel(code);
};
